import React from 'react';

const SkillCategory = ({ title, skills }) => (
  <div className="border border-[#ABB2BF] p-4 hover:border-[#C778DD] transition-colors">
    <h3 className="text-lg font-bold mb-2 text-[#C778DD]">{title}</h3>
    <div className="text-[#ABB2BF]">
      {skills.join(', ')}
    </div>
  </div>
);

const Education = ({ degree, university, duration, description }) => (
  <div className="relative pl-6 pb-8 last:pb-0">
    <div className="absolute left-0 top-2 w-2 h-2 bg-[#C778DD] rounded-full"></div>
    <div className="border-l-2 border-[#ABB2BF] pl-8 ml-[2px] pb-2">
      <div className="border border-[#ABB2BF] p-4 hover:border-[#C778DD] transition-colors">
        <h3 className="text-lg font-bold text-white">{degree}</h3>
        <p className="text-[#C778DD]">{university}</p>
        <p className="text-[#ABB2BF] text-sm mb-2">{duration}</p>
        <p className="text-[#ABB2BF]">{description}</p>
      </div>
    </div>
  </div>
);

const About = () => {
  const education = [
    {
      degree: "Master of Science in Data Analytics Engineering",
      university: "University of New Hampshire",
      duration: "2023 - Present",
      description: "Specializing in machine learning, data visualization, and big data analytics. Key coursework includes advanced statistical methods, deep learning, and data mining."
    },
    {
      degree: "Bachelor of Technology in Computer Science",
      university: "Your University Name",
      duration: "2019 - 2023",
      description: "Focused on computer science fundamentals, algorithms, and software development. Graduated with distinction."
    }
  ];

  const technicalSkills = {
    "Mathematics & Core Concepts": [
      "Gradient Descent",
      "Backpropagation",
      "Linear Algebra",
      "Probability"
    ],
    "Languages": [
      "Python",
      "R",
      "SQL (Postgres, MySQL)",
      "MongoDB"
    ],
    "Machine Learning & AI": [
      "PySpark",
      "TensorFlow",
      "Scikit-learn",
      "NumPy",
      "Pandas",
      "SciPy"
    ],
    "Data Visualization & Analytics": [
      "Power BI",
      "Tableau",
      "Matplotlib",
      "Seaborn"
    ],
    "Web & API Development": [
      "Django",
      "Flask",
      "React.js",
      "Postman",
      "JWT"
    ],
    "DevOps & Cloud": [
      "AWS (S3, Lambda, Translator)",
      "Azure (Delta Lake, Synapse Analytics)",
      "Git",
      "GitHub"
    ]
  };

  return (
    <section id="about" className="py-20 px-4 md:px-8">
      <div className="max-w-6xl mx-auto">
        <h2 className="text-3xl font-bold mb-8">
          <span className="text-[#C778DD]">#</span>about-me
        </h2>

        {/* Professional Summary */}
        <div className="mb-12">
          <h3 className="text-xl font-bold mb-4">Professional Summary</h3>
          <div className="text-[#ABB2BF] space-y-4">
            <p>
              Data Analytics Engineering graduate student with a strong foundation in machine learning,
              statistical analysis, and software development. Passionate about leveraging data-driven
              insights to solve complex problems and create innovative solutions.
            </p>
            <p>
              Experienced in developing and deploying machine learning models, creating interactive
              data visualizations, and building scalable data pipelines. Committed to continuous
              learning and staying updated with the latest advancements in AI and data science.
            </p>
          </div>
        </div>

        {/* Education */}
        <div className="mb-12">
          <h3 className="text-xl font-bold mb-4">Education</h3>
          <div className="relative">
            {education.map((edu, index) => (
              <Education key={index} {...edu} />
            ))}
          </div>
        </div>

        {/* Technical Skills */}
        <div>
          <h3 className="text-xl font-bold mb-4">Technical Skills</h3>
          <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-6">
            {Object.entries(technicalSkills).map(([category, skills]) => (
              <SkillCategory key={category} title={category} skills={skills} />
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default About;
